class ResetPasswordPrams {  ResetPasswordPrams({      this.email,       this.otp,       this.password,       this.passwordConfirmation,});  ResetPasswordPrams.fromJson(dynamic json) {    email = json['email'];    otp = json['otp'];    password = json['password'];    passwordConfirmation = json['password_confirmation'];  }  String ?email;  String ?otp;  String ?password;  String ?passwordConfirmation;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['email'] = email;    map['otp'] = otp;    map['password'] = password;    map['password_confirmation'] = passwordConfirmation;    return map;  }}